import java.io.FileNotFoundException;
import java.io.IOException;
import java.lang.reflect.Method;

import edu.washington.cs.cse490h.lib.Callback;
import edu.washington.cs.cse490h.lib.Node;
import edu.washington.cs.cse490h.lib.PersistentStorageReader;
import edu.washington.cs.cse490h.lib.PersistentStorageWriter;

/**
 * Extension to the Node class that adds support for a reliable, in-order
 * messaging layer.
 * 
 * Nodes that extend this class for the support should use RIOSend and
 * onRIOReceive to send/receive the packets from the RIO layer. The underlying
 * layer can also be used by sending using the regular send() method and
 * overriding the onReceive() method to include a call to super.onReceive()
 */
public abstract class RIONode extends Node {
	private ReliableInOrderMsgLayer RIOLayer;

	public static int NUM_NODES = 10;
	private static final String ID_FILENAME = "id.txt";

	public RIONode() {
		RIOLayer = new ReliableInOrderMsgLayer(this);
	}

	protected void ensureRIO() { /// XXX MAJOR CLUDGE
		try {
			if(RIOLayer.getInstanceID() == -1)
				RIOLayer.setInstanceID(nextInstanceID());
		} catch(IOException e) {
			e.printStackTrace();
			// ignored
		}
	}

	/**
	 * Assign a unique identifier to this node
	 * 
     * @return The unique instance identifier for this node
	 * @throws IOException 
     */
    private int nextInstanceID() throws IOException {
        int oldID;
        PersistentStorageReader idReader = null;

        try {
            idReader = getReader(ID_FILENAME);
            String oldIDString = idReader.readLine();
            if (oldIDString == null) {
                throw new AssertionError(ID_FILENAME + "should have contained an ID!");
            }

            oldID = Integer.parseInt(oldIDString);
        } catch (FileNotFoundException e) {
            // ideallly, the node class would have a method method fileExists?()
            // but there is no such method, so we just catch the exception if a file didn't exist
            oldID = -1;
        } finally {
            if(idReader != null) {
                idReader.close();
            }
        }

        int newID = oldID + 1; // XXX 2^32 - 1 overflow?

        PersistentStorageWriter idWriter = null;
        try {
            idWriter = getWriter(ID_FILENAME, false);
            idWriter.write(newID + "\n");
        } finally {
            if(idWriter != null) {
                idWriter.close();
            }
        }

        return newID;
    }

    @Override
	public void onReceive(Integer from, int pktProtocol, byte[] msg) {
    	ensureRIO();
		if(PacketProtocol.DATA.equals(pktProtocol)) {
			RIOLayer.RIODataReceive(from, msg);
		}else if(PacketProtocol.SYN.equals(pktProtocol)) {
			RIOLayer.RIOSynReceive(from, msg);
		}else if(PacketProtocol.DATA_ACK.equals(pktProtocol)) {
			RIOLayer.RIODataAckReceive(from, msg);
		}else if(PacketProtocol.SYN_ACK.equals(pktProtocol)) {
			RIOLayer.RIOSynAckReceive(from, msg);
		}else if(PacketProtocol.RE_CONN.equals(pktProtocol)) {
			RIOLayer.RIOReConnReceive(from, msg);
		}
	}

	/**
	 * Send a message using the reliable, in-order delivery layer
	 * 
	 * @param destAddr
	 *            The address to send to
	 * @param protocol
	 *            The protocol identifier of the message
	 * @param payload
	 *            The payload of the message
	 */
	public void RIOSend(int destAddr, RIOProtocol protocol, byte[] payload) {
		ensureRIO();
		RIOLayer.RIOSend(destAddr, protocol, payload);
	}

	/**
	 * Method that is called by the RIO layer when a message is to be delivered.
	 * 
	 * @param from
	 *            The address from which the message was received
	 * @param protocol
	 *            The protocol identifier of the message
	 * @param msg
	 *            The message that was received
	 */
	public abstract void onRIOReceive(Integer from, RIOProtocol protocol, byte[] msg);

	public void send(int destAddr, PacketProtocol protocol, byte[] payload) {
		ensureRIO();
		send(destAddr, protocol.toInteger(), payload);
	}

	@Override
	public String toString() {
		return RIOLayer.toString();
	}
}

